/*import components files voor Main hoofdpagina*/
import Overons from "./Overons/Overons";
import FeaturedMainPage from "./Features/Featured";

import ImageOverons from "../../img/overonssection.jpg";
import imageWaveFeatured from "../../img/wave.svg";

import "./Main.css";

const Main = () => {
    return(
        <main>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#FAF6F4" fill-opacity="1" d="M0,192L30,181.3C60,171,120,149,180,138.7C240,128,300,128,360,160C420,192,480,256,540,261.3C600,267,660,213,720,208C780,203,840,245,900,234.7C960,224,1020,160,1080,138.7C1140,117,1200,139,1260,160C1320,181,1380,203,1410,213.3L1440,224L1440,0L1410,0C1380,0,1320,0,1260,0C1200,0,1140,0,1080,0C1020,0,960,0,900,0C840,0,780,0,720,0C660,0,600,0,540,0C480,0,420,0,360,0C300,0,240,0,180,0C120,0,60,0,30,0L0,0Z"></path></svg>
            <Overons overonsAfbeelding={ImageOverons} overonSectionTitle="Af Clothing" overOnsSectionText="Bij Af designs verkopen wij Streetware kleding die voor iedereen gemaakt is. Tegenwoordig kent iedereen de Streetware trend. Lekker op de bank een comfortable Outfitje die lekker en warm is."/>
            <FeaturedMainPage featuredWaveImage={imageWaveFeatured}/>

        </main>
    )
}

export default Main;
